import logo from './logo.svg';
import './App.css';
import Box from './Box';

function App() {
  return (
    <div className="App">

       <Box name="기랑" num="1"/>
       <Box name="병신" num="2"/>
       <Box name="잡초" num="3"/>
       <Box name="딸피" num="4"/>
    </div>
  );
}

export default App;
